import React from 'react';
import { View, Text } from 'react-native';
import styled from 'styled-components/native';


interface props {
    infoTitle : string; //  ' : ' 는 필수항목, ' ?: ' 는 필수항목 X
    infoContent : string;
}

const StoreInfoEle = ({infoTitle, infoContent} : props) => {
    return (
        <SC.storeInfoWrap>
            <SC.storeInfoTitle>infoTitle</SC.storeInfoTitle>
            <SC.storeInfoText>infoContent</SC.storeInfoText>
        </SC.storeInfoWrap>
    )
}

const SC = {
    storeInfoWrap: styled.View`
        flex-Direction: row;
        justify-Content: space-between;
        margin-Bottom: 10px;
    `,
    storeInfoTitle: styled.Text`
        font-Family: Regular;
        font-Size: 12px;
        color: gray;
    `,
    storeInfoText: styled.Text`
        font-Family: Meduim;
        font-Size: 12px;
        color: gray;
    `
}
export default StoreInfoEle;
